if (typeof jQuery === 'undefined')
    throw new Error('The ' + LIBNAME + ' requires jQuery. jQuery must be included before ' + LIBNAME + '\'s JavaScript.');
(function ($) {
    const LIBNAME = 'EL_HelpInfo';
    const IMG = 'data:image/png;base64,';
    function setTitleAndSubtitle(panel, title, subtitle) {
        panel.append($('<p>').append($('<strong>').text(title).css('font-size', '20px')));
        if (subtitle || '' !== '') panel.append($('<p class="text-muted">').append($('<i>').text(subtitle)));
    }
    function couldNotLoad(panel, title, opts) {
        console.warn('The help button received an invalid content.');
        setTitleAndSubtitle(panel, title || opts.fallbackTitle, opts.couldNotLoadMessage);
    }
    function noContent(panel, title, opts) {
        console.warn('The content received by the help button does not contain any items.');
        setTitleAndSubtitle(panel, title || opts.fallbackTitle, opts.noContentMessage);
    }
    $.fn.helpButton = function (options) {
        const opts = $.extend({
            fallbackTitle: 'Help Panel',
            fallbackSubtitle: 'Select a subject for help',
            noContentMessage: 'There is no help content to show',
            couldNotLoadMessage: 'The help content could not be loaded',
            retryCount: 3,
            appKey: '',
            currentLocation: window.location.toString(),
        }, options);
        const url = opts.url + (opts.url[opts.url.length - 1] == '/' ? '' : '/') + opts.appKey;
        const panel = $('<div class="dropdown-menu dropdown-with-arrow" role="menu">');
        const content = $(this).children();
        $(this).append($('<a role="button" data-toggle="dropdown" href="#">')
               .append($('<img>').attr('src', IMG)))
               .addClass('dropdown')
               .append(panel.append(content));
        var retryCount = opts.retryCount;
        const retryFn = function() {
            if (retryCount-- > 0) {
                console.warn('Failed to get help content. Trying ' + retryCount + ' more times.');
                setTimeout(loopFn, 100);
                return true;
            }
            return false;
        }
        const loopFn = function () {
            $.ajax({
                url: url,
                data: { location: opts.currentLocation },
                crossDomain: true,
            }).done(function (result, b, c, d, e) {
				panel.contents().remove();
                if (result.content_targets === undefined) {
                    couldNotLoad(panel, result.name, opts);
                } else if (result.content_targets === null || result.content_targets.length == 0) {
                    noContent(panel, result.name, opts);
                } else if (result.content_targets !== undefined) {
                    setTitleAndSubtitle(panel, result.name || opts.fallbackTitle, result.description || opts.fallbackSubtitle)
                    const links = $('<ul>');
                    panel.append(links);
                    result.content_targets.forEach(function (item) {
                        links.append($('<li/>').append(
                            $('<a target="_blank"/>')
                                .text(item.description)
                                .attr('href', item.help_url_target)));
                    });
                }
            }).fail(function (err) {
                if (err.responseJSON !== undefined) {
					panel.contents().remove();
                    switch (err.status) {
                        case 404:
                            console.info('The help button received a status 404. Reason: ' + err.responseJSON.error);
                            noContent(panel, null, opts);
                            break;
                        case 400:
                            console.error('The help button received a status 400. Reason: ' + err.responseJSON.error);
                            couldNotLoad(panel, null , opts)
                            break;
                        default:
							console.error('The help button received error. Status: ' + err.status + ', Reason: ' + err.responseJSON.error);
							couldNotLoad(panel, null, opts);
							break;
                    }
                } else if (!retryFn()) {
                    panel.contents().remove();
					couldNotLoad(panel, null, opts);
                }
            });
        };
        loopFn();
    }

})(jQuery);
